import "./Assets/css/default.min.css";
import {
  Dashboard,
  Login,
  Register,
  Error,
  Tests,
  Settings,
  History,
  AddTest,
  Home,
} from "./pages";
import { Switch, Route, Redirect } from "react-router-dom";
import { useContext } from "react";
import Navbar from "./components/Navbar";
import Header from "./components/Header";
import { AuthContext } from "./context/AuthContext";

const AuthenticatedRoute = ({ children, ...rest }) => {
  const auth = useContext(AuthContext);
  return (
    <Route
      {...rest}
      render={() =>
        auth.isAuthenticated() ? { children } : <Redirect to="/" />
      }
    ></Route>
  );
};

const UnauthenticatedRoutes = () => (
  <Switch>
    <Route path="/login">
      <Login />
    </Route>
    <Route path="/register">
      <Signup />
    </Route>
    <Route exact path="/">
      <Home />
    </Route>
    <Route path="*">
      <Error />
    </Route>
  </Switch>
);

function App() {
  return (
    <div>
      <Header></Header>
      <Navbar type="teacher"></Navbar>
      <Switch>
        <Route path="/" exact={true}>
          <Home></Home>
        </Route>
        <Route path="/dashboard">
          <Dashboard type="teacher"></Dashboard>
        </Route>
        <Route path="/tests">
          <Tests></Tests>
        </Route>
        <Route path="/history">
          <History></History>
        </Route>
        <Route path="/addTest">
          <AddTest></AddTest>
        </Route>
        <Route path="/settings">
          <Settings></Settings>
        </Route>
        <Route path="/login">
          <Login></Login>
        </Route>
        <Route path="/register">
          <Register></Register>
        </Route>
        <Route path="*">
          <Error></Error>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
